import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import data from './data'
console.log(data[0]);

ReactDOM.render(
  <React.StrictMode>
    <div >

    </div>
       <h1 className='heading_style'> Netflix</h1>

    <Card  imgsrc={data[0].imgsrc}
    title={data[0].title}
    name={data[0].name}
    links={data[0].links}/>
    <Card  imgsrc={data[1].imgsrc}
    title={data[1].title}
    name={data[1].name}
    links={data[1].links}/>
    <Card  imgsrc={data[2].imgsrc}
    title={data[2].title}
    name={data[2].name}
    links={data[2].links}/>
    <Card  imgsrc={data[3].imgsrc}
    title={data[3].title}
    name={data[3].name}
    links={data[3].links}/>
    <Card  imgsrc={data[4].imgsrc}
    title={data[4].title}
    name={data[4].name}
    links={data[4].links}/>



  </React.StrictMode>,
  document.getElementById('root')
);

